import { StyleSheet, Text, ScrollView, View } from 'react-native'
import React from 'react'

const navData = [
    { id: 0, name: "All" },
    { id: 1, name: "Recent" },
    { id: 2, name: "Popular" },
    { id: 3, name: "Expensive" },
    { id: 4, name: "Cheap" }
]

const ScrollNav = () => {
    return (
        <ScrollView horizontal={true}>
            <View></View>
        </ScrollView>
    )
}

export default ScrollNav

const s = StyleSheet.create({})
